import { Group } from "../../../app/types/types"

export default function Spelling(props: Group){
    const userId = 1
    const {data, isSuccess} = useGetUnlernedSpellQuery({userId, groupId: props.id})
    console.log(data)
    return (
        <>
        <div className="w-full sm:w-96 mx-auto bg-white rounded-lg border border-gray-200 shadow-md dark:bg-gray-800 dark:border-gray-700">
        Spelling
        </div>
        </>

    )
}
